import React from 'react';
import { useNavigate } from 'react-router-dom';

export let BackButton : React.FC<{}> = () => {
  let navigate = useNavigate();
  const handleClick = (e: any) => {
    navigate(-1);
  };

  return (
    <React.Fragment>
      <p
        onClick={handleClick}
        style={{
          paddingLeft: '20px',
          alignSelf: 'baseline',
          color: 'blue',
          cursor: 'pointer',
          fontWeight: 700
        }}
      >
        ‚Üê back
      </p>
    </React.Fragment>
  )
}
